import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

function Header() {
  return (
    <nav className="header">
      <Link to="/" className="header-link">
        RandomPage
      </Link>
      <Link to="/feed" className="header-link">
        FeedPage
      </Link>
      <Link to="/team" className="header-link">
        TeamPage
      </Link>
    </nav>
  );
}

export default Header;
